import './App.scss';
import 'bulma';
import Header from './components/Header/Header'
import Footer from './components/Footer/Footer'

function App() {
  return (
    <div className="App">
      <Header></Header>
        <Route exact={true} path='/' component={Home} />
      <Footer></Footer>
    </div>
  );
}

export default App;
